import styled from 'styled-components';

export const DetailWrapper = styled.div`
    overflow: hidden;
    width: 620px;
    margin: 0 auto;
    padding-bottom: 100px;
    background: red;
`;

export const Header = styled.div`
    margin: 50px 0 20px 0;
    line-height: 44px;
    font-size: 30px;
    font-weight: 700;
    color: #333;
`;

export const Content = styled.div`
    .img{
        width: 1000px;
    }
    .pic-div{
        text-align: center;
    }
`;
